import TopFeature from "./features/TopFeature";
import Header from "./header/Header";
import Home from "./pages/home/Home";
import StunningDesign from "./stunningDesign/StunningDesign";
import TopBar from "./topbar/TopBar";

function App() {
  return (
    <>
      <TopBar></TopBar>
      <Header/>
      <Home/>
      <TopFeature/>
      <StunningDesign/>
    </>

  );
}

export default App;
